webpackJsonp([0x6fbc38f2922e],{8303:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Dear Elena",date:"23 Feb 2006",slug:"/2006-02-23-dear-elena/",tags:"Y2006"},html:'<p><a href="http://dearelena.wordpress.com/2006/02/23/dear-elena" title="Dear Elena &raquo; Dear Elena">Dear Elena</a>, on a parent\'s worst nightmare: "Grandparents are not supposed to bury a beautiful six year old. Neither are parents... It just happened so fast."</p>'},next:{fields:{title:"Clowns instead of Figure Skating",date:"23 Feb 2006",slug:"/2006-02-23-clowns-instead-of-figure-skating/"}},previous:{fields:{title:"One of the odd things about working remotely",date:"24 Feb 2006",slug:"/2006-02-24-one-of-the-odd-things-about-working-remotely/"}}},{node:{fields:{title:"Clowns instead of Figure Skating",date:"23 Feb 2006",slug:"/2006-02-23-clowns-instead-of-figure-skating/",tags:"Y2006"},html:'<p>For NBC, the Olympic figure skating final is <a href="http://sports.yahoo.com/olympics/torino2006/news?slug=km-nbcfigs022306&prov=yhoo&type=lgns" title="The big show - Turin 2006 Winter Olympics - Yahoo! Sports">the big show</a>, almost as big as the Super Bowl. For the German TV network ZDF it\'s no show at all. Olympic programming this evening has been pre-empted for live coverage of <a href="http://www.zdf.de/ZDFde/einzelsendung/6/0,1970,2650470,00.html" title="ZDF.de - Einzelsendung"><em>Karneval</em> in Cologne</a>. Figure skating fans here have to wait for the late night wrapup... or switch to <a href="http://eurosport.com/" title="Eurosport - The torino winter olympics live and in video">Eurosport</a>, where the Olympic coverage is better anyway. </p>'},next:{fields:{title:"Two Great Hypes That Go Great Together",date:"21 Feb 2006",slug:"/2006-02-21-two-great-hypes-that-go-great-together/"}},previous:{fields:{title:"Dear Elena",date:"23 Feb 2006",slug:"/2006-02-23-dear-elena/"}}},{node:{fields:{title:"Two Great Hypes That Go Great Together",date:"21 Feb 2006",slug:"/2006-02-21-two-great-hypes-that-go-great-together/",tags:"Y2006"},html:'<p>Current top story at Spiegel Online: <a href="http://www.spiegel.de/wissenschaft/mensch/0,1518,402182,00.html" title="Neue H5N1-F&auml;lle auf R&uuml;gen: Vogelgrippe k&ouml;nnte WM gef&auml;hrden - Wissenschaft - SPIEGEL ONLINE - Nachrichten">New H5N1 Cases: Bird Flu could endanger World Cup</a>. Now if someone could tie in the Danish Mohammed cartoons, we\'d hit the hype-trifecta.</p>'},next:{fields:{title:"If You Can't Trust Your Armored Car Company...",date:"20 Feb 2006",slug:"/2006-02-20-if-you-cant-trust-your-armored-car-company/"}},previous:{fields:{title:"Clowns instead of Figure Skating",date:"23 Feb 2006",slug:"/2006-02-23-clowns-instead-of-figure-skating/"}}}],pathPrefix:"",first:!1,last:!1,index:237,pageCount:1101}}}});
